import React, { useRef, useState, useEffect } from 'react';
import { Canvas, useFrame } from '@react-three/fiber';
import { OrbitControls, Stars, Text } from '@react-three/drei';
import * as THREE from 'three';
import './App.css';

// Fetch satellites data
async function fetchSatellites() {
  const response = await fetch('https://celestrak.com/NORAD/elements/gp.php?GROUP=active&FORMAT=json');
  const data = await response.json();
  return data;
}

function Satellite({ position, satellite, onClick }) {
  return (
    <mesh position={position} onClick={() => onClick(satellite)}>
      <sphereGeometry args={[0.05, 16, 16]} />
      <meshBasicMaterial color="red" />
    </mesh>
  );
}

function SpinningGlobe({ onClickSatellite }) {
  const globeRef = useRef();
  const [satellites, setSatellites] = useState([]);

  useEffect(() => {
    fetchSatellites().then(data => setSatellites(data)).catch(err => console.error('Failed to fetch satellites:', err));
  }, []);

  useFrame(() => {
    if (globeRef.current) {
      globeRef.current.rotation.y += 0.01;
    }
  });

  const earthTexture = new THREE.TextureLoader().load('earthmap1k.jpg');
  const bumpMap = new THREE.TextureLoader().load('earthbump1k.jpg');

  const getSatellitePositions = () => {
    return satellites.slice(0, 100).map((sat, index) => {
      const latitude = Math.random() * Math.PI - Math.PI / 2;
      const longitude = Math.random() * 2 * Math.PI;
      const radius = 3.5;
      const x = radius * Math.cos(latitude) * Math.cos(longitude);
      const y = radius * Math.sin(latitude);
      const z = radius * Math.cos(latitude) * Math.sin(longitude);
      return { x, y, z, satellite: sat };
    });
  };

  const satellitePositions = getSatellitePositions();

  return (
    <>
      <mesh ref={globeRef}>
        <sphereGeometry args={[2, 32, 32]} />
        <meshStandardMaterial map={earthTexture} bumpMap={bumpMap} bumpScale={0.05} />
      </mesh>
      {satellitePositions.map((pos, index) => (
        <Satellite
          key={index}
          position={[pos.x, pos.y, pos.z]}
          satellite={pos.satellite}
          onClick={onClickSatellite}
        />
      ))}
    </>
  );
}

function AstroTrackTitle() {
  return (
    <Text fontSize={0.5} position={[-2.5, 2.5, 0]} color="white" anchorX="left" anchorY="top">
      AstroTrack
    </Text>
  );
}

function App() {
  const [selectedSatellite, setSelectedSatellite] = useState(null);

  const handleSatelliteClick = (satellite) => {
    setSelectedSatellite(satellite);
  };

  return (
    <div className="app">
      <Canvas camera={{ position: [0, 0, 8], fov: 50 }}>
        <ambientLight intensity={0.5} />
        <directionalLight position={[5, 5, 5]} intensity={1} />
        <Stars radius={100} depth={50} count={5000} factor={7} saturation={0} fade />
        <OrbitControls />
        <SpinningGlobe onClickSatellite={handleSatelliteClick} />
        <AstroTrackTitle />
      </Canvas>
      <div className="dashboard">
        {selectedSatellite ? (
          <div>
            <h3>Satellite Information</h3>
            <p><strong>Name:</strong> {selectedSatellite.OBJECT_NAME}</p>
            <p><strong>ID:</strong> {selectedSatellite.OBJECT_ID}</p>
            <p><strong>Status:</strong> Active</p>
          </div>
        ) : (
          <p>Click a satellite to see its information.</p>
        )}
      </div>
    </div>
  );
}

export default App;
